import React, {forwardRef} from "react";

import '../Css/ClaseGatos.css';

function ClaseGatos(props, ref){

  const claseGuerrero = () => {
    setClaseGato("Guerrero");
  };

  return(
    <div className="gato-rpg">
      <div className="contenedor-caracteristicas">
        <div>
          <label>Nombre: </label>
          <input placeholder="Escriba su nombre"></input>
        </div>
        <div>
          <label>Edad: </label>
          <input placeholder="Ingrese su edad"></input>
        </div>
        <div>
          <label>Clase: </label>
          <button onClick={props.asesino}>Asesino</button>
          <button onClick={claseGuerrero}>Guerrero</button>
          <button onClick={props.healer}>Healer</button>
          <button onClick={props.mago}>Mago</button>
          <button onClick={props.tanque}>Tanque</button>
        </div>
        <div>
          <label>Arma: </label>
          <button onClick={props.daga}>Dagas</button>
          <button onClick={props.espada}>Espada</button>
          <button onClick={props.arco}>Arco</button>
          <button onClick={props.baculo}>Baculo</button>
          <button onClick={props.mandoble}>Mandoble</button>
        </div>
        <div>
          <button onClick={props.crearGato}>Crear</button>
        </div>
      </div>
      
      <div
      className="contenedor-lista"
      ref={ref}>
        {props.textoG}
      </div>
  </div>
  );
};

export default forwardRef(ClaseGatos);
